def repetido (string: str) -> bool:
    for i in range(len(string)):
        for j in range (i + 1,len(string)):
            if string [j] == string [i]:
                return True
    return False

class Solution:
    def lengthOfLongestSubstring(self, s: str) -> int:
        for i in range (len(s)):
            print (i)
            for j in range (i+1):
                sub = s[j:len(s)-i+j]
                if (not repetido(sub)):
                    return len(sub)
        return 0
    



